    int pomosna = 0;
    if(a >= 5) {
        pomosna += 5;
        a -= 5;
    }
    else {
        pomosna += a;
        a = 0;
    }
    if(b >= 5) {
        pomosna += 5;
        b -= 5;
    }
    else {
        pomosna += b;
        b = 0;
    }
    if(c >= 5) {
        pomosna += 5;
        c -= 5;
    }
    else {
        pomosna += c;
        c = 0;
    }
    if(abs(a - b) <= pomosna or abs(a - c) <= pomosna or abs(b - c) <= pomosna) {
        cout << "DA" << endl;
    }
    else {
        cout << "NE" << endl;
    }
    return 0;
}

#include <iostream>
using namespace std;

int main() {
    int x;
    cin >> x;
    
    int rezultat = 2e9;
    for(int d = 0; d <= x; d++) {
        int drvena = 5 * d;
        if(drvena >= x) {
            if(rezultat > d) {
                rezultat = d;
            }
        }
        if(drvena <= x) {
            int metalna = (x - drvena) / 10;
            if((x - drvena) % 10 > 0) {
                metalna++;
            }
            if(metalna <= d and drvena + 10 * metalna >= x) {
                if(rezultat > d + metalna) {
                    rezultat = d + metalna;
                    
                }
            }
        }
        
    }
    cout << rezultat << endl;
    return 0;
}
